import React from 'react';
import StackGrid from "react-stack-grid";
import {
    Card,
    CardHeader,
    CardTitle,
    CardImg,
    CardBody,
    CardFooter,
    Button
  } from "shards-react";

const Player = () =>{
    return(

        <div>
            <h1>All Player</h1>

            <StackGrid
              columnWidth={150}
             >
              <div key="key1">Item 1</div>
              <div key="key2">Item 2</div>
              <div key="key3">Item 3</div>
            </StackGrid>
        </div>
    )
}

export default Player;
